import React from 'react';
import cookie from 'js-cookie';

export default function Home() {
  const clickHandler = () => {
    const token = 0;
    cookie.set('jwt', token);
  };

  return (
    <div>
      <h1>{cookie.get('jwt')}</h1>
      <button onClick={clickHandler}>Logout</button>
    </div>
  );
}
